import React from "react";
import { Fade, Slide } from "react-slideshow-image";
import "react-slideshow-image/dist/styles.css";

export default function MotorSlideImg() {
  const imgSrc = ["img/bg1.jpg", "img/bg2.jpg", "img/bg3.jpg", "img/bg4.jpg"];
  const properties = {
    duration: 3500,
    transitionDuration: 500,
    infinite: true,
    indicators: true,
    canSwipe: true,
    scale: 1,
    pauseOnHover: true,
    indicators: (i) => <div className="indicator"></div>,
    prevArrow: (
      <div
        style={{
          width: "15%",
          marginRight: "0",
          position: "absolute",
          left: 0,
          height: "100vh",
        }}
      >bbbb</div>
    ),
    nextArrow: (
      <div
        style={{
          width: "15%",
          marginRight: "0",
          position: "absolute",
          right: 0,
          height: "100vh",
        }}
      >aaaa</div>
    ),
  };
  return (
    <div className="motor-slide-img-layout">
      {/* <div className="motor-slide-img-container"></div> */}
      <div style={{ transition: "1s ease" }}>
        <Slide {...properties}>
          {imgSrc.map((item, index) => (
            <div className="each-fade">
              <div>
                <img src={imgSrc[index]} />
              </div>
            </div>
          ))}
        </Slide>
      </div>
    </div>
  );
}
